It is with a heavy heart that I am moving my Christmas cut off date up to September 30th. If you place an order and pay your invoice by 11:59pm CST then I guarantee you will receive it in time for Christmas. Anything 10/1 and later is NOT guaranteed. Current production time is 6-8 weeks. It's going to get cold here (next week we have some days that are possibly to be high 60s low 40s!) Since I work in my garage, weather affects me. Most importantly I took a new job at my kids school. Between that, cups, being a mom, a wife, baseball & church I'm honestly stretched too thin. Rather than completely shut my business down I've decided to bump my Christmas cut off up. 
In addition, I will also not be booking anymore tumbler parties until the new year. I have one more booked for October that I will honor but I will not be putting anymore in my calendar until 2021.
I'm doing my BEST to continue to get current orders made. I'm up at 5am working on cups. I work at the school from 7am to 4pm and most days I don't sit down for the first time until 10pm. I LOVE making cups with every ounce of my soul, it's TRULY therapy for me. But I can't allow it to take away from my family either. I appreciate deeply all who continue to support me and all who understand my decision. I assure you there are some AMAZING tumbler makers who do nothing but this. I'm happy to put you in touch with a few if you need more. 
I appreciate you all and wish you happy holidays. I thank you for being understanding of this difficult decision.
